%script

DECLARE
  v_sql varchar2(200);
  v_setlst DBMS_DATA_MINING.SETTING_LIST;

BEGIN

-- Drop apply result

BEGIN
    v_sql := 'DROP TABLE N1_APPLY_RESULT PURGE';
    EXECUTE IMMEDIATE v_sql;
    DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
    WHEN OTHERS THEN
    DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no table exists');
END;


-- Drop lift result

BEGIN
    v_sql := 'DROP TABLE N1_LIFT_TABLE PURGE';
    EXECUTE IMMEDIATE v_sql;
    DBMS_OUTPUT.PUT_LINE (v_sql ||': succeeded');
EXCEPTION
    WHEN OTHERS THEN
    DBMS_OUTPUT.PUT_LINE (v_sql ||': drop unneccessary - no table exists');
END;

END;

%script

-- Build a classification model and then generate a lift test result and an apply result.
-- Split the Data into N1_TRAIN_DATA (randomly selected 60% of the data) and N1_TEST_DATA (remaining 40%)

BEGIN 

EXECUTE IMMEDIATE 'CREATE OR REPLACE VIEW N1_TRAIN_DATA AS SELECT * FROM DEMOGRAPHICS4_V SAMPLE (60) SEED (1)';
DBMS_OUTPUT.PUT_LINE ('Created N1_TRAIN_DATA');
EXECUTE IMMEDIATE 'CREATE OR REPLACE VIEW N1_TEST_DATA AS SELECT * FROM DEMOGRAPHICS4_V MINUS SELECT * FROM N1_TRAIN_DATA';
DBMS_OUTPUT.PUT_LINE ('Created N1_TEST_DATA');

END;

%script

BEGIN DBMS_DATA_MINING.DROP_MODEL('N1_CLASS_MODEL');
EXCEPTION WHEN OTHERS THEN NULL; END;
/
DECLARE
    v_setlst DBMS_DATA_MINING.SETTING_LIST;

BEGIN
    v_setlst('PREP_AUTO') := 'ON';
    v_setlst('ALGO_NAME') := 'ALGO_DECISION_TREE';

    DBMS_DATA_MINING.CREATE_MODEL2(
        'N1_CLASS_MODEL',
        'CLASSIFICATION',
        'SELECT * FROM N1_TRAIN_DATA',
        v_setlst,
        'CUST_ID',
        'AFFINITY_CARD');
END;

%script

-- Drop apply result table
DECLARE
  v_sql varchar2(200);
BEGIN
    v_sql := 'DROP TABLE N1_APPLY_RESULT PURGE';
    EXECUTE IMMEDIATE v_sql;
    EXCEPTION WHEN OTHERS THEN NULL;
END;
/

-- Score the data and compute lift
BEGIN
  DBMS_DATA_MINING.APPLY('N1_CLASS_MODEL','N1_TEST_DATA','CUST_ID','N1_APPLY_RESULT');
  DBMS_DATA_MINING.COMPUTE_LIFT('N1_APPLY_RESULT','N1_TEST_DATA','CUST_ID','AFFINITY_CARD',
                                'N1_LIFT_TABLE','1','PREDICTION','PROBABILITY',100);
END;

%sql 

SELECT CUST_ID, PREDICTION, ROUND(PROBABILITY,2) PROB, ROUND(COST,2) COST
  FROM N1_APPLY_RESULT WHERE PREDICTION = ${PREDICTION='1','1'|'0'} 
  AND PROBABILITY > 0.5 ORDER BY PROBABILITY DESC;

%sql 

-- View the probability of AFFINITY_CARD responders by selecting HOUSEHOLD_SIZE

SELECT A.*, B.* 
  FROM N1_APPLY_RESULT A, N1_TEST_DATA B 
  WHERE HOUSEHOLD_SIZE = ${HOUSEHOLD_SIZE='1','1'|'2'|'3'|'4-5'|'6-8'|'9+'} 
  AND A.CUST_ID = B.CUST_ID;

%script

DECLARE
    v_sql varchar2(200);
BEGIN
  v_sql := 'DROP TABLE N1_BUILD_SETTINGS PURGE';
  EXECUTE IMMEDIATE v_sql;
  EXECUTE IMMEDIATE 'CREATE TABLE N1_BUILD_SETTINGS (setting_name VARCHAR2(30),setting_value VARCHAR2(4000))';
EXCEPTION WHEN OTHERS THEN NULL;
END;
/

BEGIN DBMS_DATA_MINING.DROP_MODEL('N1_CLASS_MODEL_2');
EXCEPTION WHEN OTHERS THEN NULL; END;
/

BEGIN
  INSERT INTO N1_BUILD_SETTINGS (setting_name, setting_value) VALUES ('ALGO_NAME', 'ALGO_DECISION_TREE');
  INSERT INTO N1_BUILD_SETTINGS (setting_name, setting_value) VALUES ('PREP_AUTO', 'ON');

-- Build a Classification Model
  DBMS_DATA_MINING.CREATE_MODEL('N1_CLASS_MODEL_2', 'CLASSIFICATION', 'N1_TRAIN_DATA', 'CUST_ID',' AFFINITY_CARD', 'N1_BUILD_SETTINGS');
  DBMS_OUTPUT.PUT_LINE ('Created model: N1_CLASS_MODEL_2 ');
END;
